Preston has a hard time convincing his wife Anita about engaging in other types of lovemaking... She feels that he is insensitive about her sexual desires, liking only basic sex, but a very aggressive Preston has other ideas in mind. Anita ...    Full Descriptionconfides in her best friend Pam for help and gets some good advice. Pam had the same problem and after some great girl-girl action with Anita, gives her the phone number of a specialist. At the clinic, Dr. Marley shows Anita several educational films about other forms of lovemaking and conducts several experiments. As part of the therapy, the doctor and his aide perform in the office while a curious and eager Anita watches them with intensity. Doc Marley calls Preston into the office and the film concludes in a wild orgy!! 

This is the only Leah LeFleur video. Adult stars also making their debut in this video: Jocelyn Martene, Angela Tufts.
